<h1 class="title">20220114</h1>
<p class="author"><a href="index.html">Takala</a></p>
</header>
<p>去年の5月に近所にオープンしたカツサンド専門店「しぶきのサンド亭」を訪問した． 市内にあるカツ丼が大人気の有名店「しぶき亭」がプロデュースしている．</p>
<p><strong><a href="https://jimohack.miyagi.jp/shibukino-sandtei/">しぶきのサンド亭が荒町にオープン | 人気店コラボのカツサンド専門店</a></strong></p>
<p>ずっと行きたいと思っていたが，週に3日くらいしかオープンせず，しかも駐車場もないので， オープンから半年以上も経ってしまった．</p>
<p>購入してみる．おしゃれなパッケージである．</p>
